// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CropYieldIncentive {

    struct Farmer {
        uint id;
        address payable farmerAddress;
        string recommendedCrop;
        uint predictedYield;
        uint actualYield;
        bool rewarded;
    }

    address public owner;
    uint public farmerCount = 0;
    mapping(uint => Farmer) public farmers;
    uint public rewardAmount = 1 ether;

    event FarmerRegistered(uint id, address farmerAddress, string recommendedCrop);
    event YieldUpdated(uint id, uint actualYield);
    event RewardGiven(uint id, uint amount);

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can perform this action");
        _;
    }

    modifier onlyFarmer(uint id) {
        require(farmers[id].farmerAddress == msg.sender, "Only the registered farmer can perform this action");
        _;
    }

    // Register a farmer with a recommended crop and predicted yield
    function registerFarmer(string memory _recommendedCrop, uint _predictedYield) public {
        farmerCount++;
        farmers[farmerCount] = Farmer(farmerCount, payable(msg.sender), _recommendedCrop, _predictedYield, 0, false);
        emit FarmerRegistered(farmerCount, msg.sender, _recommendedCrop);
    }

    // Farmer updates their actual yield
    function updateYield(uint id, uint _actualYield) public onlyFarmer(id) {
        Farmer storage farmer = farmers[id];
        farmer.actualYield = _actualYield;
        emit YieldUpdated(id, _actualYield);

        // If actual yield meets or exceeds the predicted yield, give reward
        if (_actualYield >= farmer.predictedYield && !farmer.rewarded) {
            farmer.rewarded = true;
            farmer.farmerAddress.transfer(rewardAmount);
            emit RewardGiven(id, rewardAmount);
        }
    }

    // Owner can fund the contract with rewards
    function fundContract() public payable onlyOwner {}

    // Check the contract balance
    function getContractBalance() public view returns (uint) {
        return address(this).balance;
    }

    // Withdraw funds (only owner)
    function withdrawFunds() public onlyOwner {
        payable(owner).transfer(address(this).balance);
    }
}

